import React, { Component } from 'react';
import { Row, Col, Container, Form, Image, Button, Navbar, InputGroup, } from 'react-bootstrap';

// import { Row, Col, Container, Form, Image, Button } from 'react-bootstrap';
// import imgLogoSezonaPocetna from './imgPretragaPocetna/sezona-logo.png';

import './FooterPocetna.css';

export default class FooterPocetna extends Component {
	render() {
		return (
			<React.Fragment>
				<Container fluid>
					<Navbar className="bg-light justify-content-between">
						<Form inline>
							<InputGroup>
								<InputGroup.Prepend>
									<InputGroup.Text id="basic-addon1">@</InputGroup.Text>
								</InputGroup.Prepend>
								<FormControl
									placeholder="Username"
									aria-label="Username"
									aria-describedby="basic-addon1"
								/>
							</InputGroup>
						</Form>
						<Form inline>
							<FormControl type="text" placeholder="Search" className=" mr-sm-2" />
							<Button type="submit">Submit</Button>
						</Form>
					</Navbar>
				</Container>
			</React.Fragment>
		);
	}
}
